import{_ as t}from"./chunks/v5_nano_01.DMHbymF9.js";import{_ as a,a as r}from"./chunks/cuav_nano_debug_cable.BXKuvqDb.js";import{_ as o,c as i,a8 as l,o as n}from"./chunks/framework.BDnHobkS.js";const v=JSON.parse('{"title":"CUAV V5 nano 자동조종장치","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/cuav_v5_nano.md","filePath":"ko/flight_controller/cuav_v5_nano.md"}'),s={name:"ko/flight_controller/cuav_v5_nano.md"};function d(c,e,p,h,u,m){return n(),i("div",null,e[0]||(e[0]=[l('<h1 id="cuav-v5-nano-자동조종장치" tabindex="-1">CUAV V5 nano 자동조종장치 <a class="header-anchor" href="#cuav-v5-nano-자동조종장치" aria-label="Permalink to &quot;CUAV V5 nano 자동조종장치&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><strong>V5 nano</strong><sup>®</sup> is an autopilot for space-constrained applications, designed by CUAV<sup>®</sup> in collaboration with the PX4 team.</p><p>이 자동조종장치는 220mm 레이싱 드론에서 사용할 수 정도로 소형이지만, 대부분의 드론에도 충분히 사용할 수 있습니다.</p><p><img src="'+t+'" alt="V5 nano - Hero image"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The V5 nano is similar to the <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a>, but has an all-in-one form factor, fewer PWM ports (can&#39;t be used for <a href="./../airframes/airframe_reference.html">airframes</a> that use AUX ports), and does not have internal damping.</p></div><p>주요 기능은 다음과 같습니다.</p><ul><li>Full compatibility with the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk project</a> <strong>FMUv5</strong> design standard and uses the <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> for all external interfaces.</li><li>더 안정적이고 신뢰할 수 있는 센서와 함께 FMU v3보다 고급 프로세서, RAM 및 플래시 메모리.</li><li>PX4와 펌웨어 호환.</li><li>I/O 핀을 위한 넉넉한 2.6mm 간격으로 모든 인터페이스를 더 쉽게 사용할 수 있습니다.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h3 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h3><p>메인 FMU 프로세서: STM32F765◦32 비트 Arm® Cortex®-M7, 216MHz, 2MB 메모리, 512KB RAM</p><ul><li><p>내장 센서 :</p><ul><li>가속도/자이로: ICM-20689</li><li>가속도/자이로: ICM-20602</li><li>가속/자이로: BMI055</li><li>자력계 : IST8310</li><li>기압계: MS5611</li></ul></li><li><p>인터페이스 : 8개의 PWM 출력</p><ul><li>FMU의 전용 PWM/캡처 입력 3 개</li><li>CPPM 전용 RC 입력</li><li>Spektrum/DSM 및 S.Bus 전용 R/C 입력</li><li>아날로그/PWM RSSI 입력</li><li>범용 시리얼 포트 4개</li><li>I2C 포트 3개</li><li>SPI 버스 4개</li><li>2개의 CAN 버스</li><li>배터리 전압/전류에 대한 아날로그 입력</li><li>2개의 추가 아날로그 입력</li><li>nARMED 지원</li></ul></li><li><p>전원 시스템: 파워 브릭 입력: 4.75 ~ 5.5V</p></li><li><p>USB 전원 입력: 4.75~5.25V</p></li><li><p>중량과 크기</p><ul><li>Dimensions: 60*40*14mm</li></ul></li><li><p>기타 특성:</p><ul><li>작동 온도: -20 ~ 85°c (측정치)</li></ul></li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">CUAV Store</a></p><p><a href="https://www.aliexpress.com/item/33050770314.html?storeId=3257035&amp;spm=2114.12010612.8148356.9.dbe6790bjW2hpH" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (international users)</p><p><a href="https://item.taobao.com/item.htm?spm=a230r.1.14.8.26ab5258veQJRu&amp;id=569404317857&amp;ns=1&amp;abbucket=13#detail" target="_blank" rel="noreferrer">CUAV Taobao</a> (China Mainland users)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Autopilot may be purchased with included Neo GPS module</p></div><p><a id="connection"></a></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_nano.html">V5 nano Wiring Quickstart</a></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p>Download <strong>V5 nano</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port (<code>DSU7</code>). 보드에는 I/O 디버그 인터페이스가 없습니다.</p><p><img src="'+a+'" alt="Debug port (DSU7)"></p><p>The debug port (<code>DSU7</code>) uses a <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> connector and has the following pinout:</p><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>DEBUG TX(출력)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>DEBUG TX(입력)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><p>The product package includes a convenient debug cable that can be connected to the <code>DSU7</code> port. This splits out an FTDI cable for connecting the <a href="./../debug/system_console.html">PX4 System Console</a> to a computer USB port, and SWD pins used for SWD/JTAG debugging. The provided debug cable does not connect to the SWD port <code>Vref</code> pin (1).</p><p><img src="'+r+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The SWD Vref pin (1) uses 5V as Vref but the CPU is run at 3.3V!</p><p>일부 JTAG 어댑터 (SEGGER J-Link)는 Vref 전압을 사용하여 SWD 라인의 전압을 설정합니다. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>For more information see <a href="#using-jtag-for-hardware-debugging">Using JTAG for hardware debugging</a>.</p></div><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX는 SBUS_RC 커넥터의 RC 입력입니다.</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>디버그 콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>연결되지 않음 (PX4IO 없음)</td></tr></tbody></table><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p><em>V5 nano</em> must be powered from the <code>Power</code> connector during flight, and may also/alternatively be powered from <code>USB</code> for bench testing.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <code>PM2</code> connector cannot not be used for powering the <em>V5 nano</em> (see <a href="#compatibility_pm2">this issue</a>).</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The Servo Power Rail is neither powered by, nor provides power to the FMU. However, the pins marked <strong>+</strong> are all common, and a BEC may be connected to any of the servo pin sets to power the servo power rail.</p></div><h2 id="과전류-보호" tabindex="-1">과전류 보호 <a class="header-anchor" href="#과전류-보호" aria-label="Permalink to &quot;과전류 보호&quot;">​</a></h2><p>The <em>V5 nano</em> has no over current protection.</p><p><a id="Optional-hardware"></a></p><h2 id="주변-장치" tabindex="-1">주변 장치 <a class="header-anchor" href="#주변-장치" aria-label="Permalink to &quot;주변 장치&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="호환성" tabindex="-1">호환성 <a class="header-anchor" href="#호환성" aria-label="Permalink to &quot;호환성&quot;">​</a></h2><p>CUAV는 몇 가지 차별화된 디자인을 채택하고, 아래에서 설명하는 일부 하드웨어와 호환되지 않습니다.</p><p><a id="compatibility_gps"></a></p><h4 id="neo-v2-0-gps는-다른-장치와-호환되지-않습니다" tabindex="-1">Neo v2.0 GPS는 다른 장치와 호환되지 않습니다. <a class="header-anchor" href="#neo-v2-0-gps는-다른-장치와-호환되지-않습니다" aria-label="Permalink to &quot;Neo v2.0 GPS는 다른 장치와 호환되지 않습니다.&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> that is recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>The UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS receiver</a> can also be used, and is compatible with other flight controllers.</p><p><a id="compatibility_jtag"></a></p><h4 id="하드웨어-디버깅에-jtag-사용" tabindex="-1">하드웨어 디버깅에 JTAG 사용 <a class="header-anchor" href="#하드웨어-디버깅에-jtag-사용" aria-label="Permalink to &quot;하드웨어 디버깅에 JTAG 사용&quot;">​</a></h4><p><code>DSU7</code> FMU Debug Pin 1 is 5 volts - not the 3.3 volts of the CPU.</p><p>일부 JTAG 프로보는이 전압을 사용하여 타겟과 통신시 IO 레벨을 설정합니다.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><p><a id="compatibility_pm2"></a></p><h4 id="pm2는-비행-컨트롤러에-전원을-공급할-수-없습니다" tabindex="-1">PM2는 비행 컨트롤러에 전원을 공급할 수 없습니다. <a class="header-anchor" href="#pm2는-비행-컨트롤러에-전원을-공급할-수-없습니다" aria-label="Permalink to &quot;PM2는 비행 컨트롤러에 전원을 공급할 수 없습니다.&quot;">​</a></h4><p><code>PM2</code> can only measure battery voltage and current, but <strong>not</strong> power the flight controller.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not support this interface.</p></div><h2 id="알려진-이슈들" tabindex="-1">알려진 이슈들 <a class="header-anchor" href="#알려진-이슈들" aria-label="Permalink to &quot;알려진 이슈들&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. 배치번호는 V01 뒤의 4 자리 생산날짜이며 비행 컨트롤러 측면의 스티커에 표시되어 있습니다. 예를 들어, 일련 번호 Batch V011904((V01은 V5의 번호, 1904는 생산날짜, 즉 배치번호)입니다.</p><p><a id="pin1_unfused"></a></p><h4 id="sbus-dsm-rssi-인터페이스-pin1-언퓨즈" tabindex="-1">SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈 <a class="header-anchor" href="#sbus-dsm-rssi-인터페이스-pin1-언퓨즈" aria-label="Permalink to &quot;SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This is a safety issue.</p></div><p>SBUS/DSM/RSSI 인터페이스에 다른 장비(RC 수신기 제외)를 연결하지 마십시오. 장비가 손상될 수 있습니다!</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Airframe build-log using CUAV v5 nano on a DJI FlameWheel450</a></li></ul>',72)]))}const S=o(s,[["render",d]]);export{v as __pageData,S as default};
